[include fluidd.cfg]
[include Macros.cfg]
[include nevermore.cfg]
[include stealthburnerled.cfg]
[exclude_object]
[include hotkey.cfg]
[include KAMP_Settings.cfg]
[include lcd_tweaks.cfg]
[include shell_command.cfg]
[include AFC/*.cfg]
[include blobifier/blobifier.cfg]



[output_pin Chamber_Lights]
pin: PB3
PWM: TRUE 
cycle_time: 0.001
value: 1.0
shutdown_value: 0


[mmu_servo mmu_gantry_servo]   ; Define Servo
pin: mmu:PB13                   ; Servo Connection Pin to mcu
maximum_servo_angle:180        ; Max Servo Angle
minimum_pulse_width: 0.00075   ; Pulse Width Limits for PWM
maximum_pulse_width: 0.00225
initial_angle: 30              ; Servo Angle at Power Up/Reset



[mcu]
serial: /dev/serial/by-id/usb-Klipper_stm32f446xx_2D0020000E51323130373733-if00

[beacon]
serial: /dev/serial/by-id/usb-Beacon_Beacon_RevH_A959DDF55154354D38202020FF0A3306-if00

x_offset: 0 # update with offset from nozzle on your machine
y_offset: 20 # update with offset from nozzle on your machine
mesh_main_direction: x
mesh_runs: 2
contact_max_hotend_temperature: 180  
home_xy_position: 150, 150 # update with your safe position
home_z_hop: 5
home_z_hop_speed: 30
home_xy_move_speed: 500
home_method: contact # use proximity for induction homing
home_method_when_homed: proximity # after initial calibration use induction
home_autocalibrate: unhomed # contact will calibrate beacon on first home
autocal_max_retries: 10	# Number of retry attempts permitted when tolerance is exceeded. {% set PROBE_TEMP = 150 %}
    

[resonance_tester]
accel_chip: beacon
probe_points: 150, 150, 30



[printer]                           
kinematics: corexy                  
max_velocity: 500                  
max_accel: 20000			        
max_z_velocity: 50		     	    
max_z_accel: 400                   
square_corner_velocity: 20         

####################################################################################
#                [X/Y Stepper Settings]
####################################################################################
#   B --------- --- A
#   |              |
#   |------E-------|
#   |              |
#   |              |
#   |              |

[stepper_x]                         
step_pin: PE11                      
dir_pin: !PE10                     
enable_pin: !PE9                    
rotation_distance: 40               
microsteps: 64                      
full_steps_per_rotation:200         
endstop_pin: ^PB14                  
position_min: 0                     
position_endstop: 302             
position_max: 302                   
homing_speed: 100                    
homing_retract_dist: 5              
homing_positive_dir: true          

[tmc2209 stepper_x]                 
uart_pin: PE7                      
interpolate: False                  
run_current: 1.0                    
sense_resistor: 0.110               

[stepper_y]
##Connected to X-MOT (B Motor)
step_pin: PD8                       
dir_pin: !PB12                      
enable_pin: !PD9                    
rotation_distance: 40               
microsteps: 64                      
full_steps_per_rotation:200         
endstop_pin: PB1                 
position_min: -5                     
position_endstop: 300               
position_max: 300                  
homing_speed: 100                    
homing_retract_dist: 5              
homing_positive_dir: true           

[tmc2209 stepper_y]                
uart_pin: PE15                      
interpolate: False                  
run_current: 1.0                    
sense_resistor: 0.110               

####################################################################################
#  Z Stepper Settings
####################################################################################
#   z1 ----Rear --- z2
#   |              |
#   |              |
#   |              |
#   |              |
#  z0---Front--- z3
## Z-  on MOTOR2_1
[stepper_z]                        
step_pin: PD14                      
dir_pin: !PD13                      
enable_pin: !PD15                   
rotation_distance: 40               
gear_ratio: 80:16                   
microsteps: 64                      
##  In Z- Position
#endstop_pin: ^PA0
endstop_pin:probe:z_virtual_endstop # use beacon as virtual endstop
homing_retract_dist: 0 # beacon needs this to be set to 0
position_max: 280                   
position_min: -10                   
homing_speed: 3                     
second_homing_speed: 3              
homing_retract_dist: 3              

[tmc2209 stepper_z]                 
uart_pin: PD10                      
uart_address: 0
interpolate: False                  
run_current: 0.7                    
sense_resistor: 0.110               

##	In E1-MOT Position
##	Z- 左后 on MOTOR3
[stepper_z1]                        
step_pin: PE6                       
dir_pin: PC13                       
enable_pin: !PE5                    
rotation_distance: 40               
gear_ratio: 80:16                   
microsteps: 64                      

##	Make sure to update below for your relevant driver (2208 or 2209)
[tmc2209 stepper_z1]                
uart_pin: PC14                      
interpolate: False                  
run_current: 0.7                    
sense_resistor: 0.110               

##	In E2-MOT Position
##	Z2 Stepper - Rear Right
[stepper_z2]                        # 步进电机-z2
step_pin: PE2                       # Z2电机脉冲引脚
dir_pin: !PE4                       
enable_pin: !PE3                    
rotation_distance: 40               
gear_ratio: 80:16                   
microsteps: 64                      

[tmc2209 stepper_z2]               
uart_pin: PC15                      
interpolate: False                   
run_current: 0.7                    
sense_resistor: 0.110               

##	In E3-MOT Position
[stepper_z3]                        
step_pin: PD12                     
dir_pin: PC4                        
enable_pin: !PE8                    
rotation_distance: 40               
gear_ratio: 80:16                   
microsteps: 64                      

[tmc2209 stepper_z3]               
uart_pin: PA15                      
interpolate: False                  
run_current: 0.7                    
sense_resistor: 0.110               

####################################################################################
# Extruder
####################################################################################

##	In E0-MOT Position
[extruder]                         
step_pin: PD5                       
dir_pin: !PD6                       
enable_pin: !PD4                    
rotation_distance: 22.6789511 	        
gear_ratio: 50:10				    
microsteps: 16                      
full_steps_per_rotation: 200	    
nozzle_diameter: 0.400              
filament_diameter: 1.75             
##      In E0 OUT Position
heater_pin: PB15                    
sensor_type:PT1000     
sensor_pin: PC1                     
pullup_resistor: 4700
min_temp: 0                        
max_temp: 300                       
max_power: 1.0                      
min_extrude_temp: 170               
pressure_advance: 0.035             
pressure_advance_smooth_time: 0.02 
max_extrude_cross_section: 10
max_extrude_only_distance: 400




#[filament_switch_sensor my_sensor]
#pause_on_runout: True
#   When set to True, a PAUSE will execute immediately after a runout
#   is detected. Note that if pause_on_runout is False and the
#   runout_gcode is omitted then runout detection is disabled. Default
#   is True.
#runout_gcode:
#   A list of G-Code commands to execute after a filament runout is
#   detected. See docs/Command_Templates.md for G-Code format. If
#   pause_on_runout is set to True this G-Code will run after the
#   PAUSE is complete. The default is not to run any G-Code commands.
#insert_gcode:
#   A list of G-Code commands to execute after a filament insert is
#   detected. See docs/Command_Templates.md for G-Code format. The
#   default is not to run any G-Code commands, which disables insert
#   detection.
#event_delay: 3.0
#   The minimum amount of time in seconds to delay between events.
#   Events triggered during this time period will be silently
#   ignored. The default is 3 seconds.
#pause_delay: 0.5
#   The amount of time to delay, in seconds, between the pause command
#   dispatch and execution of the runout_gcode. It may be useful to
#   increase this delay if OctoPrint exhibits strange pause behavior.
#   Default is 0.5 seconds.
#debounce_delay:
#   A period of time in seconds to debounce events prior to running the
#   switch gcode. The switch must he held in a single state for at least
#   this long to activate. If the switch is toggled on/off during this delay,
#   the event is ignored. Default is 0.
#switch_pin:PA3
#   The pin on which the switch is connected. This parameter must be
#   provided.

[temperature_sensor chamber]
sensor_type: EPCOS 100K B57560G104F
sensor_pin: PC3
min_temp: -10
max_temp: 100
gcode_id: C

##	In E0-MOT Position
##	Make sure to update below for your relevant driver (2208 or 2209)
[tmc2209 extruder]                  
uart_pin: PD7                       
interpolate: False                  
run_current: 0.5                    
sense_resistor: 0.110               

####################################################################################
#Bed Heater
####################################################################################
[heater_bed]
##	SSR Pin - In BED OUT position
heater_pin: PB4                     
sensor_type: Generic 3950           
sensor_pin: PB0                     
max_power: 1                     
min_temp: 0                         
max_temp: 123                       
control: pid                       
pid_kp: 58.437                      
pid_ki: 2.347                       
pid_kd: 363.769                     

####################################################################################
#Fan Control
####################################################################################

[heater_fan hotend_fan] 
##	Hotend Fan 
pin: PA13  
tachometer_pin: PA0
tachometer_ppr: 2                     
max_power: 1.0                      
kick_start_time: 0.5                
heater: extruder                    
heater_temp: 80.0                   
fan_speed: 0.6
                      

[fan]                              
##	Print Cooling Fan
pin:  PA14                          
max_power: 1.0                      
kick_start_time: 0.5                
off_below: 0.10                     

[controller_fan controller_fan]         
pin: PC8                            
kick_start_time: 0.2                
max_power: 0.4
cycle_time: 0.046 
heater: heater_bed 

#[fan_generic exhaust_fan] 
#pin: PB3                           
#max_power: 1.0                                     
#kick_start_time: .5              

[heater_fan bed_fan]
pin: PB6                         
max_power: 1.0                                      
kick_start_time: .5 
heater: heater_bed   

[controller_fan stepper_fan]
pin: PB2                        
max_power: 0.6                                     
kick_start_time: .5 
heater: heater_bed

####################################################################################
#                          Turn off heated bed when idle
####################################################################################

[idle_timeout]
timeout: 3600000                       #If the idle time exceeds 30 minutes, the heated bed will be turned off


 
[quad_gantry_level]

gantry_corners:                    
	-60,-10
	360,370
##	Probe points
points:
	40,5
	40,235
	260,235
	260,5

#--------------------------------------------------------------------
speed: 300                          # Leveling speed
horizontal_move_z: 5               # Z axis starting height

retries: 10                          # Number of out-of-tolerance retries
retry_tolerance: 0.0080               
max_adjust: 10                      


[bed_mesh]
speed: 600
horizontal_move_z: 2
probe_count: 15,15
Mesh_min:20,25
Mesh_max:260,230
zero_reference_position: 175, 175
bicubic_tension:0.2
algorithm: bicubic
mesh_pps: 0,0             

####################################################################################
# Pi and MCU temperature monitoring
####################################################################################

[temperature_sensor mcu]
sensor_type: temperature_mcu
sensor_mcu: mcu
min_temp: 0
max_temp: 100

[temperature_sensor Pi]
sensor_type: temperature_host
sensor_path:/sys/class/thermal/thermal_zone0/temp
min_temp: 0
max_temp: 100


####################################################################################
#                   mini12864 LCD Display
####################################################################################

[display]
#	mini12864 LCD Display           
lcd_type: uc1701
cs_pin: PC11
a0_pin: PD2
rst_pin: PC10
encoder_pins: ^PC6,^PC7
click_pin: ^!PA8
contrast: 63
spi_software_mosi_pin: PA7
spi_software_miso_pin: PA6
spi_software_sclk_pin: PA5

[neopixel fysetc_mini12864]
#	To control Neopixel RGB in mini12864 display
pin: PC12                           
chain_count: 3                      
initial_RED: 0.1                    
initial_GREEN: 0.5                  
initial_BLUE: 0.0                   
color_order: RGB                   

#	Set RGB values on boot up for each Neopixel. 
#	Index 1 = display, Index 2 and 3 = Knob
[delayed_gcode setdisplayneopixel]
initial_duration: 1
gcode:
        SET_LED LED=fysetc_mini12864 RED=1 GREEN=1 BLUE=1 INDEX=1 TRANSMIT=0
        SET_LED LED=fysetc_mini12864 RED=1 GREEN=0 BLUE=0 INDEX=2 TRANSMIT=0
        SET_LED LED=fysetc_mini12864 RED=1 GREEN=0 BLUE=0 INDEX=3 



